version = "0.21.4"
source = { editable = "." }
dependencies = [
    { name = "numpy", version = "1.24.4", source = { registry = "https://pypi.org/simple" }, marker = "python_full_version < '3.9'" },
    { name = "numpy", version = "2.0.2", source = { registry = "https://pypi.org/simple" }, marker = "python_full_version == '3.9.*'" },
    { name = "numpy", version = "2.2.3", source = { registry = "https://pypi.org/simple" }, marker = "python_full_version >= '3.10'" },
    { name = "readchar" },
]

[package.dev-dependencies]
dev = [
    { name = "mypy" },
    { name = "pandas", version = "2.0.3", source = { registry = "https://pypi.org/simple" }, marker = "python_full_version < '3.9'" },
    { name = "pandas", version = "2.2.3", source = { registry = "https://pypi.org/simple" }, marker = "python_full_version >= '3.9'" },
    { name = "polars", version = "1.8.2", source = { registry = "https://pypi.org/simple" }, marker = "python_full_version < '3.9'" },
    { name = "polars", version = "1.25.2", source = { registry = "https://pypi.org/simple" }, marker = "python_full_version >= '3.9'" },
    { name = "pyinstrument" },
    { name = "pytest" },
    { name = "ruff" },
]

[package.metadata]
requires-dist = [
    { name = "numpy", specifier = ">=1.22.0" },
    { name = "readchar", specifier = ">=4.2.1" },
]

[package.metadata.requires-dev]
dev = [
    { name = "mypy", specifier = "==1.14.1" },
    { name = "pandas", specifier = ">=2.0.3" },
    { name = "polars", specifier = ">=0.20.5" },
    { name = "pyinstrument", specifier = ">=5.0.3" },
    { name = "pytest", specifier = ">=6.0.1" },
    { name = "ruff", specifier = ">=0.9.0" },
]
